import React, { useState, useEffect } from 'react'

export default function Move({ move, getMoveType, getMoveCategory }) {
  const [moveData, setMoveData] = useState('')

  const fetchMoveData = async () => {
    try {
      const response = await fetch(move.move.url);
      const responseData = await response.json(); // Parse the response JSON
      setMoveData(responseData);
      console.log(moveData);
    } catch (error) {
      console.log('Error:', error.message);
    }
  };

  useEffect(() => {
    fetchMoveData();
  }, []); 

  return (
    <li key={move.move.name}>
      <strong>{move.move.name}</strong>
      <br />
      Type: {getMoveType(moveData)} {/* Use moveData instead of move */}
      <br />
      Category: {getMoveCategory(moveData)} {/* Use moveData instead of move */}
    </li>
  );  
}
